(1, '<p><img src="http://placehold.it/400x350" /></p>\r\n', 'Ad Block - Sidebar Ad', 'full_html'),
(2, '<p>Aliquam tincidunt nisl vel nibh accumsan, eu porttitor leo blandit. Donec aliquet lorem a nisl luctus sollicitudin. Etiam purus nisi, tincidunt sit amet gravida vel, consequat sed metus.&nbsp;</p>\r\n', 'Custom Block - About Us', 'full_html'),
(3, '<p>Copyright © 2014 BizReview. Designed by <a href="http://www.symphonythemes.com">Symphony Themes</a>. All rights reserved.</p>\r\n', 'Custom Block - Copyright', 'full_html'),
(4, '<ul class="footer-list">\r\n	<li>\r\n		<a href="#">Frequently Asked Questions</a></li>\r\n	<li>\r\n		<a href="#">Our Terms and Conditions</a></li>\r\n	<li>\r\n		<a href="#">Advertisment</a></li>\r\n	<li>\r\n		<a href="#">Privacy Policy</a></li>\r\n	<li>\r\n		<a href="#">Community Guidelines</a></li>\r\n</ul>\r\n', 'Custom Block - Useful Links', 'full_html'),
(5, '<ul class="list-social-icons">\r\n	<li>\r\n		Join us on </li>\r\n	<li>\r\n		<a href=" #" title="Facebook"><i class="fa fa-facebook"></i></a></li>\r\n	<li>\r\n		<a href="#" title="Twitter"><i class="fa fa-twitter"></i></a></li>\r\n	<li>\r\n		<a href="#" title="Google Plus"><i class="fa fa-google-plus"></i></a></li>\r\n	<li>\r\n		<a href="#" title="Pinterest"><i class="fa fa-pinterest"></i></a></li>\r\n	<li>\r\n		<a href="#" title="LinkedIn"><i class="fa fa-linkedin"></i></a></li>\r\n	<li>\r\n		<a href="#" title="Youtube"><i class="fa fa-youtube-play"></i></a></li>\r\n</ul>\r\n', 'Custom Block - Social Icons', 'full_html'),
(6, '<h2 class="home-block-title rtecenter">\r\n	Welcome to <span class="themecolor-text">SmartDir</span></h2>\r\n<p class="home-block-description rtecenter">Why you should join a growing network of enthusiastists</p>\r\n<div class="col-md-4">\r\n	<p class="rtecenter"><i class="fa fa-cutlery fa-3x themecolor-text">&nbsp;</i></i></i></p>\r\n	<p class="rtecenter"><i class="fa fa-cutlery fa-3x themecolor-text">List our own business for free. Be visible and be searchable to millions of users.</i></p>\r\n</div>\r\n<div class="col-md-4">\r\n	<p class="rtecenter"><i class="fa fa-cutlery fa-3x themecolor-text"><i class="fa fa-thumbs-o-up fa-3x themecolor-text"></i></i></p>\r\n	<p class="rtecenter"><i class="fa fa-cutlery fa-3x themecolor-text">Review and recommend places that you visited. Share your feelings, your experiences and earn praises.</i></p>\r\n</div>\r\n<div class="col-md-4">\r\n	<p class="rtecenter"><i class="fa fa-cutlery fa-3x themecolor-text"><i class="fa fa-comments-o fa-3x themecolor-text"></i></i></p>\r\n	<p class="rtecenter"><i class="fa fa-cutlery fa-3x themecolor-text">Be a part of a growing community, with a thousand of enthusiasts, just like you.</i></p>\r\n</div>\r\n', 'Custom Block - Welcome to SmartDir', 'full_html'),
(7, '<h2 class="home-block-title rtecenter">\r\n	Are you excited? Join SmartDir now.</h2>\r\n<p class="home-block-description rtecenter">To connect with thousand enthusiastists like you</p>\r\n<p class="rtecenter"><a class="btn btn-lg btn-primary" href="user/register"><i class="fa fa-user"></i>&nbsp; Join BizReview!</a></p>\r\n', 'Custom Block - Join BizReview', 'full_html'),
(8, '<h2 class="home-block-title rtecenter">\r\n	Download our <span class="themecolor-text">mobile</span> apps</h2>\r\n<p class="home-block-description rtecenter">To keep track of everything which happens around you</p>\r\n<p class="rtecenter"><button class="btn btn-border" type="button"><i class="fa fa-apple themecolor-text"></i>&nbsp;iPhone App</button>&nbsp;&nbsp;&nbsp;<button class="btn btn-border" type="button"><i class="fa fa-android themecolor-text"></i>&nbsp;Android App</button>&nbsp;&nbsp;&nbsp;<button class="btn btn-border" type="button"><i class="fa fa-windows themecolor-text"></i>&nbsp;Windows App</button></p>\r\n<p class="rtecenter"><img alt="" src="http://placehold.it/400x400" style="margin-bottom: -60px;" /></p>\r\n', 'Custom Block - Mobile Apps of SmartDir', 'full_html'),
(9, '<div id="fb-root">\r\n	&nbsp;</div>\r\n<script>(function(d, s, id) {\r\n  var js, fjs = d.getElementsByTagName(s)[0];\r\n  if (d.getElementById(id)) return;\r\n  js = d.createElement(s); js.id = id;\r\n  js.src = "//connect.facebook.net/en_EN/all.js#xfbml=1&appId=285891560611";\r\n  fjs.parentNode.insertBefore(js, fjs);\r\n}(document, ''script'', ''facebook-jssdk''));</script>\r\n<div class="fb-like-box" data-colorscheme="light" data-header="false" data-href="https://www.facebook.com/symphonythemes" data-show-border="true" data-show-faces="true" data-stream="false">\r\n	&nbsp;</div>\r\n', 'Custom Block - Facebook Like Box', 'full_html'),
