(11, '<div class="row">\r\n	<div class="col-md-6">\r\n		<p><img src="http://placehold.it/200x200.png" /></p>\r\n	</div>\r\n	<div class="col-md-6">\r\n		<p>Vivamus sit amet libero turpis, non venenatis urna.</p>\r\n		<p><button class="btn btn-primary" type="button"><i class="fa fa-mobile"></i>&nbsp;&nbsp; Download</button></p>\r\n	</div>\r\n</div>\r\n', 'Custom Block - Mobile Apps Sidebar', 'full_html'),
