(13, '<h2 class="home-block-title rtecenter">\r\n	See <span class="themecolor-text">advertising options</span> on SmartDir</h2>\r\n<p class="home-block-description rtecenter">In blandit, odio convallis suscipit venenatis, ante ipsum cursus augue.</p>\r\n<p class="rtecenter"><img alt="" src="/drupal7/smartdir/sites/default/files/images/ad-sample-highlighted.jpg" style="margin-bottom: -80px;" /></p>\r\n', 'Custom Block - Advertising Options', 'full_html'),
(14, '<h2 class="home-block-title rtecenter">Registration guide with screenshots</h2>\r\n\r\n<p class="home-block-description rtecenter">Sed blandit augue vitae augue scelerisque bibendum. Vivamus sit amet libero turpis, non venenatis urna.</p>\r\n\r\n<div class="col-md-4">\r\n<p class="rtecenter"><a class="colorbox-inline" href="?width=800&amp;height=500&amp;inline=true#pic1"><img alt="" src="/drupal7/bizreview/sites/default/files/images/guide_register-1.jpg" style="width: 300px; height: 183px;" /></a></p>\r\n\r\n<div style="display: none;">\r\n<div id="pic1"><img src="/drupal7/bizreview/sites/default/files/images/guide_register-1.jpg" /></div>\r\n</div>\r\n\r\n<p class="rtecenter">Fill up this registration form and confirm your email address</p>\r\n</div>\r\n\r\n<div class="col-md-4">\r\n<p class="rtecenter"><a class="colorbox-inline" href="?width=800&amp;height=500&amp;inline=true#pic2"><img alt="" src="/drupal7/bizreview/sites/default/files/images/guide_register-2.jpg" style="width: 300px; height: 183px;" /></a></p>\r\n<div style="display: none;">\r\n<div id="pic2"><img src="/drupal7/bizreview/sites/default/files/images/guide_register-2.jpg" /></div>\r\n</div>\r\n<p class="rtecenter">Click on My Listings, select <span class="themecolor-text">Submit a listing</span></p>\r\n</div>\r\n\r\n<div class="col-md-4">\r\n<p class="rtecenter"><a class="colorbox-inline" href="?width=800&amp;height=500&amp;inline=true#pic3"><img alt="" src="/drupal7/bizreview/sites/default/files/images/guide_register-3.jpg" style="width: 300px; height: 183px;" /></a></p>\r\n<div style="display: none;">\r\n<div id="pic3"><img src="/drupal7/bizreview/sites/default/files/images/guide_register-3.jpg" /></div>\r\n</div>\r\n<p class="rtecenter">Fill in the submit form. We will feedback within 24 hours.</p>\r\n</div>\r\n', 'Custom Block - Registration Steps', 'full_html'),
(15, '<h2 class="home-block-title">\r\n	Connect with <span class="themecolor-text">Bizreview</span></h2>\r\n<div class="col-md-3 connect-with-biz">\r\n	<div class="connect-with-biz-icon">\r\n		<span class="fa-stack fa-lg fa-3x"><i class="fa fa-circle fa-stack-2x"></i><i class="fa fa-users fa-stack-1x fa-inverse"></i></span></div>\r\n	<div class="connect-with-biz-content">\r\n		<h3>\r\n			7.3 Million</h3>\r\n		<p>Members</p>\r\n	</div>\r\n</div>\r\n<div class="col-md-3 connect-with-biz">\r\n	<div class="connect-with-biz-icon">\r\n		<span class="fa-stack fa-lg fa-3x"><i class="fa fa-circle fa-stack-2x"></i><i class="fa fa-comments fa-stack-1x fa-inverse"></i></span></div>\r\n	<div class="connect-with-biz-content">\r\n		<h3>\r\n			20 Million</h3>\r\n		<p>Review</p>\r\n	</div>\r\n</div>\r\n<div class="col-md-3 connect-with-biz">\r\n	<div class="connect-with-biz-icon">\r\n		<span class="fa-stack fa-lg fa-3x"><i class="fa fa-circle fa-stack-2x"></i><i class="fa fa-check fa-stack-1x fa-inverse"></i></span></div>\r\n	<div class="connect-with-biz-content">\r\n		<h3>\r\n			Over 500K</h3>\r\n		<p>Subscriptions</p>\r\n	</div>\r\n</div>\r\n<div class="col-md-3 connect-with-biz">\r\n	<div class="connect-with-biz-icon">\r\n		<span class="fa-stack fa-lg fa-3x"><i class="fa fa-circle fa-stack-2x"></i><i class="fa fa-thumbs-up fa-stack-1x fa-inverse"></i></span></div>\r\n	<div class="connect-with-biz-content">\r\n		<h3>\r\n			20 Million</h3>\r\n		<p>Followers</p>\r\n	</div>\r\n</div>\r\n<p>&nbsp;</p>\r\n', 'Custom Block - Connect with Bizreview', 'full_html'),
