('node', 'full_page', 0, 70, 70, 'und', 0, '<p class="home-block-description rtecenter">Your investment will turn to highest values</p>\r\n<div class="col-md-3">\r\n	<p class="rtecenter"><i class="fa fa-user fa-3x themecolor-text"></i></p>\r\n	<p class="rtecenter">10K+ active users, 100 new daily accounts</p>\r\n</div>\r\n<div class="col-md-3">\r\n	<p class="rtecenter"><i class="fa fa-paper-plane-o fa-3x themecolor-text"></i></p>\r\n	<p class="rtecenter">Active community of reviews with over 2000+ new monthly reviews</p>\r\n</div>\r\n<div class="col-md-3">\r\n	<p class="rtecenter"><i class="fa fa-trophy fa-3x themecolor-text"></i></p>\r\n	<p class="rtecenter">Highest ROI rate, highest click rate</p>\r\n</div>\r\n<div class="col-md-3">\r\n	<p class="rtecenter"><i class="fa fa-magnet fa-3x themecolor-text"></i></p>\r\n	<p class="rtecenter">Strong brand building, many famous brands are here already</p>\r\n</div>\r\n<p>&nbsp;</p>\r\n<div class="col-md-3">\r\n	<p class="rtecenter"><i class="fa fa-bolt fa-3x themecolor-text"></i></p>\r\n	<p class="rtecenter">Active forum with 300 new weekly threads.</p>\r\n</div>\r\n<div class="col-md-3">\r\n	<p class="rtecenter"><i class="fa fa-th-list fa-3x themecolor-text"></i></p>\r\n	<p class="rtecenter">Provide monthly report with transparent statistics.</p>\r\n</div>\r\n<div class="col-md-3">\r\n	<p class="rtecenter"><i class="fa fa-support fa-3x themecolor-text"></i></p>\r\n	<p class="rtecenter">Recommendations for high rankings and click rates.</p>\r\n</div>\r\n<div class="col-md-3">\r\n	<p class="rtecenter"><i class="fa fa-paper-plane-o fa-3x themecolor-text"></i></p>\r\n	<p class="rtecenter">Opt out at anytime, no hidden cost.</p>\r\n</div>\r\n', '', 'full_html'),
('node', 'full_page', 0, 71, 71, 'und', 0, '<p class="home-block-description rtecenter">Why we enjoy our working environment so much!</p>\r\n<div class="col-md-3">\r\n	<p class="rtecenter"><i class="fa fa-lightbulb-o fa-3x themecolor-text"></i></p>\r\n	<p class="rtecenter">Creative everywhere! Ideas are just around the corner.</p>\r\n</div>\r\n<div class="col-md-3">\r\n	<p class="rtecenter"><i class="fa fa-paper-plane-o fa-3x themecolor-text"></i></p>\r\n	<p class="rtecenter">Frequent vacations and flexible leaves.</p>\r\n</div>\r\n<div class="col-md-3">\r\n	<p class="rtecenter"><i class="fa fa-coffee fa-3x themecolor-text"></i></p>\r\n	<p class="rtecenter">Unlimited food and coffee on office canteens.</p>\r\n</div>\r\n<div class="col-md-3">\r\n	<p class="rtecenter"><i class="fa fa-smile-o fa-3x themecolor-text"></i></p>\r\n	<p class="rtecenter">Laugh and more laugh. Joys and more joys.</p>\r\n</div>\r\n<p>&nbsp;</p>\r\n<div class="col-md-3">\r\n	<p class="rtecenter"><i class="fa fa-gamepad fa-3x themecolor-text"></i></p>\r\n	<p class="rtecenter">Fun and relax. Games are hosted every week.</p>\r\n</div>\r\n<div class="col-md-3">\r\n	<p class="rtecenter"><i class="fa fa-dollar fa-3x themecolor-text"></i></p>\r\n	<p class="rtecenter">High bonus for excellent performance.</p>\r\n</div>\r\n<div class="col-md-3">\r\n	<p class="rtecenter"><i class="fa fa-child fa-3x themecolor-text"></i></p>\r\n	<p class="rtecenter">Bring families to office. This is your family.</p>\r\n</div>\r\n<div class="col-md-3">\r\n	<p class="rtecenter"><i class="fa fa-glass fa-3x themecolor-text"></i></p>\r\n	<p class="rtecenter">Office party every weekend.</p>\r\n</div>\r\n', '', 'full_html'),
