('node', 'page', 0, 79, 79, 'und', 0, '<p>We have fully integrated the entire Font Awesome 4 Icon Set with <strong>BizReview</strong>. Below is some examples of how you can use Font awesome to create beautiful icons. Each icon has 3 different sizes; Large, Medium or Small; and with or without a circle behind. Icon color, circle color and circle border can also be changed directly in the shortcode!</p>\r\n<div class="col-md-4">\r\n	<h3>\r\n		Large icon</h3>\r\n	<p><i class="fa fa fa-wheelchair fa-4x"></i>&nbsp;<i class="fa fa fa-picture-o fa-4x"></i>&nbsp;<i class="fa fa fa-sitemap fa-4x"></i></p>\r\n</div>\r\n<div class="col-md-4">\r\n	<h3>\r\n		Medium icon</h3>\r\n	<p><i class="fa fa-magnet fa-2x"></i>&nbsp;<i class="fa fa-asterisk fa-2x"></i>&nbsp;<i class="fa fa-bar-chart fa-2x"></i>&nbsp;<i class="fa fa-beer"></i>&nbsp;<i class="fa fa-bell fa-2x"></i>&nbsp;<i class="fa fa-bookmark fa-2x"></i>&nbsp;<i class="fa fa-fighter-jet"></i>&nbsp;<i class="fa fa-cloud-upload fa-2x"></i>&nbsp;<i class="fa fa-credit-card"></i>&nbsp;<i class="fa fa-mobile-phone fa-2x"></i>&nbsp;<i class="fa fa-edit fa-2x"></i></p>\r\n</div>\r\n<div class="col-md-4">\r\n	<h3>\r\n		Small icon</h3>\r\n	<p><i class="fa fa-wrench"></i>&nbsp;<i class="fa fa-save"></i>&nbsp;<i class="fa fa-user"></i>&nbsp;<i class="fa fa-columns"></i>&nbsp;<i class="fa fa-upload"></i>&nbsp;<i class="fa fa-file"></i>&nbsp;<i class="fa fa-tint"></i>&nbsp;<i class="fa fa-envelope"></i>&nbsp;<i class="fa fa-link"></i>&nbsp;<i class="fa fa-eye-open"></i>&nbsp;<i class="fa fa-thumbs-up"></i>&nbsp;<i class="fa fa-coffee"></i>&nbsp;<i class="fa fa-tasks"></i>&nbsp;<i class="fa fa-check-empty"></i>&nbsp;<i class="fa fa-tag"></i>&nbsp;<i class="fa fa-gift"></i>&nbsp;<i class="fa fa-spinner"></i>&nbsp;<i class="fa fa-pushpin"></i>&nbsp;<i class="fa fa-move"></i>&nbsp;<i class="fa fa-headphones"></i>&nbsp;<i class="fa fa-music"></i>&nbsp;<i class="fa fa-heart-empty"></i>&nbsp;<i class="fa fa-ok"></i>&nbsp;<i class="fa fa-remove