('node', 'page', 0, 84, 84, 'und', 0, '<p>This theme is integrated with Drupal Commerce and Paypal payment method. Users will choose the package when submitting a listing:</p>\r\n<p class="rtecenter"><img alt="" src="/drupal7/bizreview/sites/default/files/images/bizreview_payment-options.jpg" style="width: 1000px; height: 380px;" /></p>\r\n<p>Then they will be directed to checkout and pay via Paypal.</p>\r\n<p class="rtecenter"><img alt="" src="/drupal7/bizreview/sites/default/files/images/bizreview_payment-shopping-cart.jpg" style="width: 1000px; height: 414px;" /></p>\r\n<p class="rtecenter"><img alt="" src="/drupal7/bizreview/sites/default/files/images/bizreview_payment.checkout.jpg" style="width: 1000px; height: 829px;" /></p>\r\n<p class="rtecenter"><img alt="" src="/drupal7/bizreview/sites/default/files/images/bizreview_payment-paypal.jpg" style="width: 1000px; height: 814px;" /></p>\r\n', '', 'full_html'),
('node', 'page', 0, 87, 87, 'und', 0, '<p>The theme is accessible on all mobile devices. You will not miss any potential customers.</p>\r\n<p class="rtecenter"><img alt="" src="/drupal7/bizreview/sites/default/files/images/bizreview-mobile.jpg" style="width: 400px; height: 300px;" />&nbsp;&nbsp; <img alt="" src="/drupal7/bizreview/sites/default/files/images/bizreview-tablet-2.jpg" style="width: 400px; height: 300px;" /></p>\r\n', '', 'full_html'),
