('node', 'faq', 0, 69, 69, 'und', 3, 'Maecenas dignissim, lectus eget posuere vehicula?', 'Integer dapibus lobortis placerat. Vestibulum at lorem nibh. Maecenas porttitor tempor enim, a imperdiet mi faucibus eu. Duis pretium eros velit, in bibendum elit sollicitudin eget. Nullam sodales metus vel est gravida iaculis. Suspendisse dapibus lacinia sapien ac gravida. ', NULL),
