('node', 'full_page', 0, 40, 40, 'und', 0, '<p class="home-block-description rtecenter">Lorem ipsum dolor sit amet, consectetur adipiscing elit. Phasellus quis lectus metus, at posuere neque.</p>\r\n<div class="col-md-4">\r\n	<p class="rtecenter"><span class="fa-stack fa-4x themecolor-text"><i class="fa fa-circle fa-stack-2x"></i><i class="fa fa-flag fa-stack-1x fa-inverse"></i></span></p>\r\n	<p class="rtecenter">Expose your business to thousands of potential customers</p>\r\n</div>\r\n<div class="col-md-4">\r\n	<p class="rtecenter"><span class="fa-stack fa-4x themecolor-text"><i class="fa fa-circle fa-stack-2x"></i><i class="fa fa-volume-up fa-stack-1x fa-inverse"></i></span></p>\r\n	<p class="rtecenter">Build your online presence and your own audiences</p>\r\n</div>\r\n<div class="col-md-4">\r\n	<p class="rtecenter"><span class="fa-stack fa-4x themecolor-text"><i class="fa fa-circle fa-stack-2x"></i><i class="fa fa-money fa-stack-1x fa-inverse"></i></span></p>\r\n	<p class="rtecenter">Push up your revenue when strengthening your brand</p>\r\n</div>\r\n', '', 'full_html'),
('node', 'page', 0, 41, 41, 'und', 0, '<p>Need some spaces to monetize your websites? You can sell ad spaces, like a homepage ad or sidebar ad block like this image.</p>\r\n<p class="rtecenter"><img alt="" class="hwalgfkocgetznlpajxb" src="/drupal7/bizreview/sites/default/files/images/ad_home-page.jpg" /></p>\r\n<p class="rtecenter">&nbsp;</p>\r\n<p class="rtecenter"><img alt="" src="/drupal7/bizreview/sites/default/files/images/ad_listing.jpg" /></p>\r\n', '', 'full_html'),
('node', 'page', 0, 42, 42, 'und', 0, '<p>As an user of the website (not an administrative ones), the interface is easy and friendly.</p>\r\n<p>This is a list of all listing submitted by the user and their status.</p>\r\n<p class="rtecenter"><img alt="" src="/drupal7/bizreview/sites/default/files/images/user_my-listings.resized.jpeg" /></p>\r\n<p>Also, the list of all reviews left by the user is shown on the My Reviews link</p>\r\n<p class="rtecenter"><img alt="" src="/drupal7/bizreview/sites/default/files/images/user_my-reviews.resized.jpeg" /></p>\r\n<p>We will update more features such as social network to this theme soon.</p>\r\n', '', 'full_html'),
('node', 'page', 0, 43, 43, 'und', 0, '<p>This theme comes with many map layers for you to choose. See the demo below:</p>\r\n', '', 'full_html'),
('node', 'page', 0, 44, 44, 'und', 0, '<h2 class="home-block-title rtecenter">\r\n	Welcome to <span class="themecolor-text">BizReview</span></h2>\r\n<p class="home-block-description rtecenter">Why you should join a growing network of enthusiastists</p>\r\n<div class="col-md-4">\r\n	<p class="rtecenter"><span class="fa-stack fa-4x themecolor-text"><i class="fa fa-circle fa-stack-2x"></i><i class="fa fa-paper-plane-o fa-stack-1x fa-inverse"></i></span></p>\r\n	<p class="rtecenter">List our own business for free. Be visible and be searchable to millions of users.</p>\r\n</div>\r\n<div class="col-md-4">\r\n	<p class="rtecenter"><span class="fa-stack fa-4x themecolor-text"><i class="fa fa-circle fa-stack-2x"></i><i class="fa fa-thumbs-o-up fa-stack-1x fa-inverse"></i></span></p>\r\n	<p class="rtecenter">Review and recommend places that you visited. Share your feelings, your experiences and earn praises.</p>\r\n</div>\r\n<div class="col-md-4">\r\n	<p class="rtecenter"><span class="fa-stack fa-4x themecolor-text"><i class="fa fa-circle fa-stack-2x"></i><i class="fa fa-smile-o fa-stack-1x fa-inverse"></i></span></p>\r\n	<p class="rtecenter">Be a part of a growing community, with a thousand of enthusiasts, just like you.</p>\r\n</div>\r\n', '', 'full_html');
