(1, 2, 'Restaurant', 'Nulla nisl urna, faucibus eu est eu, rhoncus gravida diam. Ut egestas placerat eros, ultrices pharetra metus rutrum ac. Sed id mollis libero. Vivamus fermentum consectetur erat sit amet mattis.', 'filtered_html', 2),
(2, 2, 'Nightlife', 'Duis tincidunt sodales enim, ut tincidunt arcu cursus in. Donec tellus neque, sodales hendrerit suscipit vitae, eleifend ac sem. Etiam at fringilla neque, quis rutrum magna. Nulla porttitor ac mauris nec placerat. ', 'filtered_html', 0),
(3, 2, 'Shopping', 'Vestibulum ante ipsum primis in faucibus orci luctus et ultrices posuere cubilia Curae; Ut interdum vel risus a auctor. Nam sapien diam, tristique in nisl et, tempor aliquam dui. Etiam sed imperdiet quam, at imperdiet quam. ', 'filtered_html', 1),
(4, 2, 'Beauty & Spa', 'Duis imperdiet, ligula sit amet tincidunt consequat, risus erat lacinia turpis, vel hendrerit enim nunc non nunc. Proin interdum egestas mauris at sollicitudin.', 'filtered_html', 4),
(5, 2, 'Hotels & Travel', '<p>Proin ac nibh semper, pretium nisl sed, hendrerit leo. Proin nec tincidunt ante. Aliquam sed sodales justo. Fusce luctus, mauris non semper dignissim, risus enim venenatis erat, convallis congue nunc est vulputate urna. Cras dictum tincidunt eleifend. Integer purus sapien, consequat id risus vitae, rutrum elementum felis.</p>\r\n', 'full_html', 5),
(6, 2, 'Automotive', '<p>Pellentesque turpis augue, tincidunt a porttitor et, egestas et nisi. Phasellus ac sollicitudin mauris. Praesent posuere ullamcorper ligula sed molestie.</p>\r\n', 'filtered_html', 3),
